import React, { Component } from 'react';

export default class Input extends Component {
  render() {
    const { type, label, id } = this.props;

    return (
      <label htmlFor="inputName">
        { label }
        <input
          type={ type }
          id={ id }
          data-testid="name-input"
        />
      </label>
    );
  }
}
